import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Toolbar from './components/Toolbar';
import LandingPage from './components/LandingPage';
import Footer from './components/Footer';
import Novedades from './components/Novedades';
import DondeEstamos from './components/DondeEstamos';

function App() {
	const toolbarInfo={
		nombre: 'Valeria Peralta'
	}
	const landingInfo = {
		sobreNosotros: "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an.",
	}
	const dondeEstamos = {
		dondeEstamos: "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an.",
		ubicacion: ""
	}
	return (
		<div className="App">
			<Toolbar toolbarInfo={toolbarInfo}></Toolbar>
			<LandingPage landingInfo={landingInfo}></LandingPage>
			<Novedades></Novedades>
			<DondeEstamos></DondeEstamos>
			<Footer></Footer>

		</div>
	);
}

export default App;
